  render() {
    return (
      <div className="App-body-project">
        <h2>Disco Bot</h2>
        <h3>Feb. â€“ May 2019</h3>
        <div className="App-body-project-video">
          <video className="video-js" controls preload="auto" poster={discobot}
          data-setup={'{}'}>
            <source src={discobotvid} type="video/mp4" />
